import React, { useEffect } from 'react';
import { useStarWarsContext } from './Context/StarWarsContext';

const TablePlanets = () => {
  const { data, getPlanetsStarWars } = useStarWarsContext;

  useEffect(() => {
    getPlanetsStarWars();
  }, []);

  return (
    <div>
      { console.log(data)}
    </div>
  );
};

export default TablePlanets;
